window.bookSummaryJSON = "<p>With no answers and a weapon of mass destruction slung around his neck, Gage Crosse is left with little choice but to travel with Joey Mosely to New York, seeking aid from the Order Council itself. Little do they know that they are about to embark on what may be the greatest adventure of their lives: to find the mysterious Seal of Solomon. </p> <p>Meanwhile, the fragile threads holding the demon army and its monstrous allies together are unraveling. Keli must act quickly to maintain her position as ruler, or else have all their efforts fall into the ruin. </p> <p>Can the Journeymen keep the Seal of Solomon out of demon hands, or will the Noctis succeed in wrenching all three artifacts from their control? </p> <p><i>Warning:</i> This book is for mature listeners only. Not for children. It contains adult themes, violence, coarse language, sexual situations, nudity, and paranormal themes. </p>"; 
